You can use the `localeCompare()` method to achieve case-sensitive sorting in JavaScript. Here is an example:
```javascript
const arr = ['Zebra', 'apple', 'Banana', 'cat', 'Dog'];

arr.sort((a, b) => a.localeCompare(b, undefined, { sensitivity: 'case' }));

console.log(arr); // Output: ['apple', 'Banana', 'cat', 'Dog', 'Zebra']
```
In this example, the `localeCompare()` method is used as the compare function for the `sort()` method. The `sensitivity` option is set to `'case'` to enable case-sensitive sorting.

Alternatively, you can use the `charCodeAt()` method to compare the ASCII values of the characters:
