You can change the background color of an Adaptive Card by adding a `background` property to the `container` element. However, the Adaptive Card Designer may not always reflect the changes immediately. Here are a few things you can try:

1. **Add a `background` property to the `container` element**: In the Adaptive Card Designer, select the container element that you want to change the background color for. Then, in the Properties panel, click on the "Add property" button and select "background". Enter the desired background color value (e.g., `#FF0000` for red).
2. **Use the `background` property with a `color` value**: Instead of using a `background` property with a `color` value, try using a `background` property with a `color` value, like this: `"background": {"color": "#FF0000"}`. This should work in the Adaptive Card Designer.
3. **Check the Adaptive Card schema version**: Make sure that your Adaptive Card schema version is set to 1.3 or later. You can check the schema version in the Adaptive Card Designer by clicking on the "File" menu and selecting "Properties". If your schema version is earlier than 1.3, you may need to update it to use the `background` property.
4. **Try rendering the card in a different client**: Sometimes, the Adaptive Card Designer may not render the background color correctly. Try rendering the card in a different client, such as the Adaptive Cards SDK for .NET or the Adaptive Cards SDK for JavaScript, to see if the background color is applied correctly.

Here is an example of how you can add a `background` property to a container element in the Adaptive Card Designer:
